// src/pages/Home.js
import React from 'react';
import Button from '../components/Button';
import Navbar from '../components/Navbar';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div
      className="relative min-h-screen bg-cover bg-center"
      style={{
        backgroundImage: "url('https://source.unsplash.com/1600x900/?delivery')", // Ensure this is an object
      }}
    >
      {/* Dark overlay for text contrast */}
      <div className="absolute inset-0 bg-black opacity-40"></div>

      <div className="relative z-10 text-center text-white py-20 px-5">
        <Navbar />
        <h1 className="text-4xl md:text-5xl font-bold leading-tight mb-4">
          Fast, Reliable, and Efficient Delivery Service
        </h1>
        <p className="text-lg md:text-xl mb-6">
          Get your packages delivered quickly and safely, right to your doorstep!
        </p>

        <div className="flex justify-center space-x-4">
          <Link to="/register">
            <Button text="Register Now" />
          </Link>
          <Link to="/login">
  <Button
    text="Login"
    className="bg-transparent border-2 border-white text-white hover:bg-white hover:text-black"
  />
</Link>

        </div>
      </div>
    </div>
  );
};

export default Home;
